import { withRouter } from 'next/router';

function Navbar() {
    return (
        <>
            <nav>
                Objection
            </nav>
            <style jsx>{`
                nav {
                    height: 114 px;
                    flex: 10;
                    display: flex;
                    text-align: center;
                    font-family: Verdana, sans-serif;
                }
            `}</style>
        </>
    )
}

export default withRouter(({ router }) => {
    const { route } = router;
    return (
        <Navbar
            route={route}
        />
    );
});
